INSERT INTO media ( type, name, originalLanguage, adult, releaseDate, overview, backdropPath, posterPath, trailerLink, tmdbRating, totalRating, voteCount, status) VALUES( true, 'American Dad!', 'en', False, '2005-02-06',  'The series focuses on an eccentric motley crew that is the Smith family and their three housemates: Father, husband, and breadwinner Stan Smith; his better half housewife, Francine Smith; their college-aged daughter, Hayley Smith; and their high-school-aged son, Steve Smith. Outside of the Smith family, there are three additional main characters, including Hayley''s boyfriend turned husband, Jeff Fischer; the family''s man-in-a-goldfish-body pet, Klaus; and most notably the family''s zany alien, Roger, who is "full of masquerades, brazenness, and shocking antics."', 'https://image.tmdb.org/t/p/original/mc3rG5M9dFVjMfaCFNfbD5gu2pK.jpg', 'https://image.tmdb.org/t/p/original/xnFFz3etm1vftF0ns8RMHA8XdqT.jpg', 'https://www.youtube.com/watch?v=apr31MFjg08', 6.9, 0, 0, 'Returning Series') ON CONFLICT DO NOTHING;
