INSERT INTO media ( type, name, originalLanguage, adult, releaseDate, overview, backdropPath, posterPath, trailerLink, tmdbRating, totalRating, voteCount, status) VALUES( true, 'The Adventures of Ozzie and Harriet', 'en', False, '1952-10-03',  'The Adventures of Ozzie and Harriet is an American sitcom, airing on ABC from October 3, 1952 through March 26, 1966, starring the real life Nelson family. After a long run on radio, the show was brought to television where it continued its success, running on both radio and television for a few years. The series stars Ozzie Nelson and his wife, singer Harriet Nelson, and their young sons, David and Eric "Ricky" Nelson. Don DeFore had a recurring role as the Nelsons'' friendly neighbor "Thorny".', 'https://image.tmdb.org/t/p/original/z9ipjaUaoRWMl6vvQnLhpuFfkBu.jpg', 'https://image.tmdb.org/t/p/original/h9Kqsng08I3CtA5m2GVq52NVUIL.jpg', 'None', 5.8, 0, 0, 'Ended') ON CONFLICT DO NOTHING;
