INSERT INTO media ( type, name, originalLanguage, adult, releaseDate, overview, backdropPath, posterPath, trailerLink, tmdbRating, totalRating, voteCount, status) VALUES( true, 'Jujutsu Kaisen', 'ja', False, '2020-10-03',  'Yuji Itadori is a boy with tremendous physical strength, though he lives a completely ordinary high school life. One day, to save a classmate who has been attacked by curses, he eats the finger of Ryomen Sukuna, taking the curse into his own soul. From then on, he shares one body with Ryomen Sukuna. Guided by the most powerful of sorcerers, Satoru Gojo, Itadori is admitted to Tokyo Jujutsu High School, an organization that fights the curses... and thus begins the heroic tale of a boy who became a curse to exorcise a curse, a life from which he could never turn back.', 'https://image.tmdb.org/t/p/original/gmECX1DvFgdUPjtio2zaL8BPYPu.jpg', 'https://image.tmdb.org/t/p/original/hFWP5HkbVEe40hrXgtCeQxoccHE.jpg', 'https://www.youtube.com/watch?v=VpO6APNqY1c', 8.6, 0, 0, 'Returning Series') ON CONFLICT DO NOTHING;
